Note 1:	Band Selection is based on set theory. For each feature, item number shall correspond to the Band number. The result is the set of bands for which the test shall be conducted. The following operators are used:
			AND: 	Set intersection (  ). {1,2} AND {2,3} = {2}
			OR: 	Set union (  ). {1,2} OR {2,3} = {1,2,3}
			NOT: 	Set complement (\), full set being all bands. NOT{1} = {2 ...256}
				Also note that this is set without repetitions so {1} AND {1} = {1}
	The following basic sets are used:
			FDD:				All FDD bands, currently {1...32, 65…70}
			TDD: 				All TDD bands, currently {33...64}
			Category NB1:	All Category NB1 bands, currently {1, 2, 3, 5, 8, 11, 12, 13, 17, 18, 19, 20, 21, 25,, 26, 28, 31, 66, 70}
			{1,2}:				Explicitly given band set
	The following sets derived from pro-forma tables are also used:
			A.4.X-Y:	All bands supporting the feature defined in A.4.X-Y. For A.4.3-3, all supported bands. 
			FALLBACK(A.4.6.X-Y): Fallback bands of supported CA Combinations defined in Table A.4.6.X-Y
Note 2:	Category NB1 Bands < 1GHz {5, 8, 12, 13, 17, 18, 19, 20, 26, 28, 31}
Note 3:	Category NB1 Bands > 1GHz {1, 2, 3, 11, 21, 25, 66, 70}
Note 4:	Category NB1 and NB2 Bands > 1GHz {41}

